import s from './Content.module.css'
import MyPosts from './MyPosts/MyPosts'
import Dialog from "../Dialogs/Dialog/Dialog";
const Cont = (props) => {
    let contMap = props.contents.map( (el)=>{
        return(
            <MyPosts post = {el.post}/>
        )
    })
    return (
        <ul>
            contMap
        </ul>
    )
}

export default Cont;
